import React, { Component } from 'react';
// import './App.css';

class MovieImg extends Component {
    constructor(props) {
        super(props);
    }

    _onMouseOver(){
        this.props.movieDisplayUpdateCallback('movieDetails');
    }

    _renderMovieImg() {
        try {
            return (
                <div className="movieImg" onMouseOver={this._onMouseOver}>
                    <img src={this.props.item.Poster}></img>
                </div>
            );
        }
        catch (err) { }
    }

    render() {
        return this._renderMovieImg()
    }
}

export default (MovieImg);
